export class Vacuna {
    constructor(id, nombre, estado, fechaAplicacion, subsidiada, valor, dosis, idUsuario, dosisPendiente, tiempoEntreDosis) {
        this.id = id;
        this.nombre = nombre;
        this.estado = estado;
        this.fechaAplicacion = fechaAplicacion;
        this.subsidiada = subsidiada;
        this.valor = valor;
        this.dosis = dosis;
        this.idUsuario = idUsuario;
        this.dosisPendiente = dosisPendiente;
        this.tiempoEntreDosis = tiempoEntreDosis;
    }
}
